<script lang="ts">
import Vue from "vue";
import Countdown from "~/components/general/Countdown.vue";
import LazyTube from "vue-lazytube";

Vue.use(LazyTube)
export default Vue.extend({
  components: { Countdown },
  name: "IndexPage",
  data() {
    return {
      youtubeLink: "https://www.youtube.com/embed/D7GHelwdayE?si=_LPiYnR3H0p1S1KZ&player=html5",
      scrollY: 0,
    };
  },
  mounted() {
    this.scrollY = window.scrollY - window.innerHeight;
    // Listen to the scroll event to update the scrollY property dynamically
    window.addEventListener("scroll", this.handleScroll);

    var delay = (Math.random() * 1000) % 60;
    var slider = document.getElementById('logos-slider')
    if (slider != null ) {
      slider.style.animationDelay = "-" + delay + "s";
    }

    var coll = document.getElementsByClassName("collapsible");
    const collapsibles = Array.from(coll);
    collapsibles.forEach(collapsibl => {
      collapsibl.addEventListener("click", (evt) => {
        collapsibl.classList.toggle("active-collapsible");
        if (collapsibl !== null) {
          var content = collapsibl.parentElement?.nextElementSibling as HTMLElement;
          if (content != null) {
            if (content.style.maxHeight == "0px" || content.style.maxHeight == ""){
              content.style.maxHeight = content.scrollHeight + "px";
              content.classList.add("mb-7")
              content.classList.add("sm:mb-14")
           } else {
              content.style.maxHeight = "0";
              content.classList.remove("mb-7")
              content.classList.remove("sm:mb-14")
            }
          }
        }
      })
    })
  },

  methods: {
    handleScroll() {
      this.scrollY = window.scrollY;
    },
    changePig(fillColor: string) {
      var piggy = document.getElementById("piggy");
      if (piggy != null) {
        piggy.style.fill = fillColor;
      }
    },
    changeArrow(opacity: string) {
      var arrow = document.getElementById("arrow");
      if (arrow != null) {
        arrow.style.opacity = opacity;
      }
    }
  },

  watch: {
    scrollY(newValue: number) {
      var main = document.getElementById("main");
      var valYidea = document.getElementById("idea")?.getBoundingClientRect().y ?? -100;
      var valYprog = document.getElementById("program")?.getBoundingClientRect().y ?? -100;
      var valYwspar = document.getElementById("wsparcie")?.getBoundingClientRect().y ?? -100;
      var valYnews = document.getElementById("newsletter")?.getBoundingClientRect().y ?? -100;
      var copyright = document.getElementById("copyright")?.getBoundingClientRect().y ?? -100;
      var blendews = document.getElementById("blendnews");
    var eop = copyright - window.innerHeight;
      if (valYnews <= 50 || eop < 0) {
        main?.classList.remove("bg-[#9966FF]");
        main?.classList.add("bg-[#47D141]");
        blendews?.classList.remove("bg-[#9966FF]");
        blendews?.classList.add("bg-[#47D141]");
      } else if (valYwspar <= 50) {
        main?.classList.remove("bg-[#FFA9C9]");
        main?.classList.add("bg-[#9966FF]");
        blendews?.classList.remove("bg-[#47D141]");
        blendews?.classList.add("bg-[#9966FF]");
      } else if (valYprog <= 50) {
        main?.classList.remove("bg-[#FF4B0F]");
        main?.classList.add("bg-[#FFA9C9]");
      } else if (valYidea <= 50) {
        main?.classList.remove("bg-[#FFF1E3]");
        main?.classList.remove("bg-[#FFA9C9]");
        main?.classList.add("bg-[#FF4B0F]");
      } else {
        main?.classList.remove("bg-[#FFF1E3]");
        main?.classList.remove("bg-[#FFA9C9]");
